import org.openqa.selenium.WebDriver;
import org.openqa.selenium.WebElement;
import org.openqa.selenium.support.FindBy;
import org.openqa.selenium.support.PageFactory;

public class GivingGroupPage {
    private WebDriver driver;

    @FindBy(xpath = "//button[contains(text(),'Add admin')]")
    private WebElement addAdminButton;

    @FindBy(xpath = "//input[@placeholder='Search by name or email']")
    private WebElement searchAdminInput;

    @FindBy(xpath = "//button[contains(text(),'Add')]")
    private WebElement addAdminSubmitButton;

    @FindBy(xpath = "//button[contains(text(),'Remove')]")
    private WebElement removeAdminButton;

    public GivingGroupPage(WebDriver driver) {
        this.driver = driver;
        PageFactory.initElements(driver, this);
    }

    public void clickAddAdminButton() {
        addAdminButton.click();
    }

    public void searchAndAddAdmin(String adminName) {
        searchAdminInput.sendKeys(adminName);
        addAdminSubmitButton.click();
    }

    public void clickRemoveAdminButton() {
        removeAdminButton.click();
    }
}
